<title>Untitled Document</title>
<script type="text/javascript">

function generarPDF() {
	
	var nombre=document.getElementById('nom').value;
	var apepat=document.getElementById('apepat').value;
	var apemat=document.getElementById('apemat').value;
	var dni=document.getElementById('dni').value;
	var cod=document.getElementById('cod').value;
	var imagen=document.getElementById("laimagen");
	var logo='data:image/jpeg;base64,'
	
	var i=document.getElementById("laimagen");
	var j=i.getAttribute("src");
	
	if(j==""){
		alert("Genere primero el codigo QR");
		}
	
	
	else{

	var doc = new jsPDF();
    doc.setFontSize(15);
	doc.setFont("times");
	
	
	doc.rect(10, 10, 190, 200); 
	doc.addImage(logo,'JPEG',10,5,60,20)
	doc.text(50,50, 'UNIVERSIDAD DE SAN MARTIN DE PORRES');
	doc.text(50,55, 'FACULTAD DE INGENIERA Y ARQUITECTURA ');
	doc.rect(18, 65, 100, 40); 
	doc.text(20, 70, 'Evento : Vision 2013');
	doc.text(20, 80, 'Nombre (S) :' + "  "+ nombre);
	doc.text(20, 90, 'Apellido (S) : ' + "  " + apepat + "  " +apemat);
	doc.text(20, 100, 'DNI :' + " "+ dni);
	doc.text(20,110, 'Codigo :' + " "+ cod);
	doc.addImage(imagen,'JPEG', 80, 120, 60, 60);
	
	// Output as Data URI
	doc.output('datauri');
	}
}
